from ctypes import *
from cryptography.fernet import Fernet
from base64 import b64decode
import os

the_obj = ""
def encrypt(s):
	message = s
	key = Fernet.generate_key()
	fernet = Fernet(key)
	enc = fernet.encrypt(message)
	return enc, key

def decrypt(m, k):
	fernet = Fernet(k)
	dec = fernet.decrypt(m)
	return dec

def check_real_key(key):
	with open("/tmp/wutt.so", "wb") as f:
		f.write(b64decode(the_obj))
		f.close()
	s_obj = "/tmp/wutt.so"
	funcs = CDLL(s_obj)
	funcs.check.restype = c_char_p
	if (funcs.check(bytes(key))) == b"000":
		os.remove("/tmp/wutt.so")
		return  True

def banner():
	txt = """[1] encrypt\n[2] decrypt\n[3] check the key for flag decryption"""
	return txt

def main():
	print(banner())
	option = str(input(">>> "))
	
	if option not in ["1", "2", "3"]:
		print (" Bad choice")
		quit()
	
	if option == "1":
		m = str(input("Enter the message you want to encrypt: "))
		m = m.encode()
		e_m = encrypt(m)
		print ("Encrypted Message: {}\nKey: {}".format(e_m[0], e_m[1]))
	
	if option == "2":
		d_enc = str(input("Enter the encrypted message: "))
		d_enc = d_enc.encode()
		d_key = str(input("Enter the key: "))
		d_key = d_key.encode()
		print(decrypt(d_enc, d_key))

	if option == "3":
		if not check_real_key(str(input("Enter the key for encrypted flag\n>>> ")).encode()):
			print ("Aight! Immma Head Out!!!")
		else:
			print("Oooooh.. That's the correct key ma boyy!!")

if __name__ == '__main__':
	main()
